ActivateKeyboardLayout.Data:
.DLL命令 ActivateKeyboardLayout, 整数型, "user32", "ActivateKeyboardLayout", 激活一个新的键盘布局。键盘布局定义了按键在一种物理性键盘上的位置与含义　如执行成功，返回前一个键盘布局的句柄；零表示失败。会设置GetLastError
    .参数 HKL, 整数型, , 指定一个键盘布局的句柄。这个布局是随同LoadKeyboardLayout 或 GetKeyboardLayoutList函数载入的。也可用HKL_NEXT常数激活下一个已装载布局；或用HKL_PREV载入前一个布局
    .参数 Flags, 整数型, , 将指定的键盘移至内部键盘布局列表的起始处;

Beep.Data:
.DLL命令 Beep, 整数型, "kernel32", "Beep", 用于生成简单的声音　TRUE（非零）表示成功，否则返回零。会设置GetLastError
    .参数 dwFreq, 整数型, , 声音频率（从37Hz到32767Hz）。在windows95中忽略
    .参数 dwDuration, 整数型, , 声音的持续时间，以毫秒为单位。如为-1，表示一直播放声音，直到再次调用该函数为止。在windows95中会被忽略;

ClientToScreen.Data:
.DLL命令 ClientToScreen, 整数型, "user32", "ClientToScreen", 判断窗口内以客户区坐标表示的一个点的屏幕坐标　非零表示成功，零表示失败
    .参数 hwnd, 整数型, , 判断客户区坐标时那个窗口的句柄
    .参数 lpPoint, POINTAPI, , POINTAPI，用hwnd窗口的客户区坐标表示的点，这个参数会包含屏幕坐标系统中相同的点;

CompareFileTime.Data:
.DLL命令 CompareFileTime, 整数型, "kernel32", "CompareFileTime", 根据FILETIME结构的信息，对比两个文件的时间　如两个时间相等，就返回零；如lpFileTime1小于lpFileTime2，返回-1；如lpFileTime2小于lpFileTime1，返回1
    .参数 lpFileTime1, FILETIME, , FILETIME，参考FILETIME
    .参数 lpFileTime2, FILETIME, , ;

ConnectNamedPipe.Data:
.DLL命令 ConnectNamedPipe, 整数型, "kernel32", "ConnectNamedPipe", 指示一台服务器等待下去，直至客户机同一个命名管道连接　如lpOverlapped为NULL，那么：;     □ 如管道已连接，就返回Ture（非零）；如发生错误，或者管道已经连接，就返回零（GetLastError此时会返回ERROR_PIPE_CONNECTED）;     □ lpOverlapped有效，就返回零；如管道已经连接，GetLastError会返回ERROR_PIPE_CONNECTED；如重叠操作成功完成，就返回ERROR_IO_PENDING。在这两种情况下，倘若一个客户已关闭了管道，且服务器尚未用DisconnectNamedPipe函数同客户断开连接，那么GetLastError都会返回ERROR_NO_DATA
    .参数 hNamedPipe, 整数型, , 管道的句柄
    .参数 lpOverlapped, OVERLAPPED, , OVERLAPPED，如设为NULL（传递ByVal As Long），表示将线程挂起，直到一个客户同管道连接为止。否则就立即返回；此时，如管道尚未连接，客户同管道连接时就会触发lpOverlapped结构中的事件对象。随后，可用一个等待函数来监视连接适用平台Windows NT;

ConnectToPrinterDlg.Data:
.DLL命令 ConnectToPrinterDlg, 整数型, "winspool.drv", "ConnectToPrinterDlg", 启动连接打印机对话框，用它同访问网络的打印机连接　已连接或选择的打印机的句柄，零意味着失败或用户取消了操作
    .参数 hwnd, 整数型, , 对话框的父窗口句柄
    .参数 flags, 整数型, , 保留，设为零;

CopyEnhMetaFile.Data:
.DLL命令 CopyEnhMetaFile, 整数型, "gdi32", "CopyEnhMetaFileA", 制作指定增强型图元文件的一个副本（拷贝）　如执行成功，返回副本的句柄。零表示失败。会设置GetLastError
    .参数 hemfSrc, 整数型, , 欲复制的增强型图元文件的句柄
    .参数 lpszFile, 文本型, , 副本的文件名（要在磁盘上创建一个新的图元文件）。可用vbNull向这个参数传递一个NULL值，以便在内存中创建副本;

CopyMetaFile.Data:
.DLL命令 CopyMetaFile, 整数型, "gdi32", "CopyMetaFileA", 制作指定（标准）图元文件的一个副本　如执行成功，则返回副本的句柄。零表示失败。会设置GetLastError
    .参数 hMF, 整数型, , 指向欲复制的图元文件的句柄
    .参数 lpFileName, 文本型, , 新图元文件的文件名。可用vbNull向这个参数传递一个NULL值，以便在内存中创建副本;

CopyRect.Data:
.DLL命令 CopyRect, 整数型, "user32", "CopyRect", 将矩形的lpSourceRect内容复制给矩形lpDestRect　非零表示成功，零表示失败。会设置GetLastError
    .参数 lpDestRect, RECT, , RECT，目标矩形结构
    .参数 lpSourceRect, RECT, , RECT，源矩形;

CreateEllipticRgn.Data:
.DLL命令 CreateEllipticRgn, 整数型, "gdi32", "CreateEllipticRgn", 创建一个椭圆，该椭圆与X1，Y1和X2，Y2坐标点确定的矩形内切　执行成功则为区域句柄，失败则为零
    .参数 X1, 整数型, , 矩形左上角X，Y坐标
    .参数 Y1, 整数型, , 同上
    .参数 X2, 整数型, , 矩形右下角X，Y坐标;  
    .参数 Y2, 整数型, , 同上;

CreateHatchBrush.Data:
.DLL命令 CreateHatchBrush, 整数型, "gdi32", "CreateHatchBrush", 创建带有阴影图案的一个刷子（阴影图案见注解）　如执行成功，返回指向新刷子的一个句柄。否则返回零。注意在不需要时，用DeleteObject清除刷子
    .参数 nIndex, 整数型, , 象下图那样指定一种阴影类型
    .参数 crColor, 整数型, , 指定刷子的RGB前景色;

CreateRectRgn.Data:
.DLL命令 CreateRectRgn, 整数型, "gdi32", "CreateRectRgn", 创建一个由点X1，Y1和X2，Y2描述的矩形区域　执行成功为区域句柄，失败则为零
    .参数 X1, 整数型, , 矩形左上角X，Y坐标
    .参数 Y1, 整数型, , 同上
    .参数 X2, 整数型, , 矩形右下角X，Y坐标;  
    .参数 Y2, 整数型, , 同上;

DeleteForm.Data:
.DLL命令 DeleteForm, 整数型, "winspool.drv", "DeleteFormA", 从打印机可用表单列表中删除一个表单　非零表示成功，零表示失败。会设置GetLastError
    .参数 hPrinter, 整数型, , 一个打开的打印机的名字（用OpenPrinter获得）
    .参数 pFormName, 文本型, , 欲删除的表单的名字适用平台Windows NT;

DrawFocusRect.Data:
.DLL命令 DrawFocusRect, 整数型, "user32", "DrawFocusRect", 画一个焦点矩形。这个矩形是在标志焦点的样式中通过异或运算完成的（焦点通常用一个点线表示）。如用同样的参数再次调用这个函数，就表示删除焦点矩形　非零表示成功，零表示失败。会设置GetLastError
    .参数 hdc, 整数型, , 设备场景的句柄
    .参数 lpRect, RECT, , RECT，要在逻辑坐标中描绘的矩形;

EnableWindow.Data:
.DLL命令 EnableWindow, 整数型, "user32", "EnableWindow", 在指定的窗口里允许或禁止所有鼠标及键盘输入（在vb里使用：在vb窗体和控件中使用Enabled属性）　非零表示成功，零表示失败。会设置GetLastError
    .参数 hwnd, 整数型, , 窗口句柄
    .参数 fEnable, 整数型, , 非零允许窗口，零禁止;

EnumSystemCodePages.Data:
.DLL命令 EnumSystemCodePages, 整数型, "KERNEL32", "EnumSystemCodePagesA", 枚举系统中已安装或支持的代码页　TRUE（非零）表示成功，零表示失败。会将GetLastError设置设为下述某个常数：ERROR_BADDB，ERROR_INVALID_FLAGS，ERROR_INVALID_PARAMETER
    .参数 lpCodePageEnumProc, 整数型, , 指向为每个代码页都调用的一个函数的指针。用Addressof运算符得到位于一个标准模块中的函数的地址
    .参数 dwFlags, 整数型, , 常数CP_INSTALLED表示枚举已安装的所有代码页，CP_SUPPORTED表示枚举所有支持的代码页;

EnumSystemLocales.Data:
.DLL命令 EnumSystemLocales, 整数型, "KERNEL32", "EnumSystemLocalesA", 枚举系统已经安装或提供支持的“地方”设置　TRUE（非零）表示成功，零表示失败。会将GetLastError设置设为下述某个常数：ERROR_BADDB，ERROR_INVALID_FLAGS，ERROR_INVALID_PARAMETER
    .参数 lpLocaleEnumProc, 整数型, , 指向为每个“地方”都调用的一个函数的指针。用Addressof运算符得到位于一个标准模块中的函数的地址
    .参数 dwFlags, 整数型, , 常数LCID_INSTALLED表示枚举已安装的所有地方；LCID_SUPPORTED则枚举所有支持的地方;

EnumWindows.Data:
.DLL命令 EnumWindows, 整数型, "user32.dll", "EnumWindows", 枚举窗口列表中的所有父窗口（顶级和被所有窗口）　非零表示成功，零表示失败
    .参数 lpEnumFunc, 整数型, , 指向为每个子窗口都调用的一个函数的指针。用AddressOf运算符获得函数在标准模式下的地址
    .参数 lParam, 整数型, , 在枚举期间，传递给dwcbkd32.ocx定制控件之EnumWindows事件的值。这个值的含义是由程序员规定的;

EqualRect.Data:
.DLL命令 EqualRect, 整数型, "user32", "EqualRect", 判断两个矩形结构是否相同　非零表示成功，零表示失败。会设置GetLastError
    .参数 lpRect1, RECT, , RECT，要比较的矩形
    .参数 lpRect2, RECT, , RECT，要比较的矩形;

EqualRgn.Data:
.DLL命令 EqualRgn, 整数型, "gdi32", "EqualRgn", 确定两个区域是否相等　若两区域相等为非零值。若不等为0。若有一个区域无效则返回ERRORAPI
    .参数 hSrcRgn1, 整数型, , 一个区域的句柄
    .参数 hSrcRgn2, 整数型, , 区域句柄;

ExcludeUpdateRgn.Data:
.DLL命令 ExcludeUpdateRgn, 整数型, "user32", "ExcludeUpdateRgn", 从专用设备场景剪裁区去掉指定窗口的刷新区域。这防止对无效区绘图（该无效区将推迟一点再刷新）　见ExcludeClipRect函数返回值
    .参数 hdc, 整数型, , 设备场景，其剪裁区将被修改以排除hwnd窗口的刷新区
    .参数 hwnd, 整数型, , 窗口句柄在vb中使用设您要完成一个较长或复杂的绘图操作，该函数可允许您避免画到现在没有遮盖而随后即将画的区域。这可提高性能并消除闪烁效果;

ExitWindowsEx.Data:
.DLL命令 ExitWindowsEx, 整数型, "user32", "ExitWindowsEx", 退出windows，并用特定的选项重新启动　非零表示成功，零表示失败。会设置GetLastError
    .参数 uFlags, 整数型, , 指定下述一个或多个标志（用OR运算符合并到一起）;EWX_FORCE：强迫中止没有响应的进程;EWX_LOGOFF：中止进程，然后注销;EWX_SHUTDOWN：关掉系统电源（如果可能的话，ATX电源就可以）;EWX_REBOOT：重新引导系统;EWX_SHUTDOWN：关闭系统
    .参数 dwReserved, 整数型, , 保留，设为零;

FileTimeToLocalFileTime.Data:
.DLL命令 FileTimeToLocalFileTime, 整数型, "kernel32", "FileTimeToLocalFileTime", 将一个FILETIME结构转换成本地时间　非零表示成功，零表示失败。会设置GetLastError
    .参数 lpFileTime, FILETIME, , FILETIME，包含了UTC时间信息的一个结构
    .参数 lpLocalFileTime, FILETIME, , FILETIME，用于装载转换过后的本地时间的结构;

FileTimeToSystemTime.Data:
.DLL命令 FileTimeToSystemTime, 整数型, "kernel32", "FileTimeToSystemTime", 根据一个FILETIME结构的内容，装载一个SYSTEMTIME结构　非零表示成功，零表示失败。会设置GetLastError
    .参数 lpFileTime, FILETIME, , FILETIME，包含了文件时间的一个结构
    .参数 lpSystemTime, SYSTEMTIME, , SYSTEMTIME，用于装载系统时间信息的一个结构;

FindFirstFile.Data:
.DLL命令 FindFirstFile, 整数型, "kernel32", "FindFirstFileA", 根据文件名查找文件　如执行成功，返回一个搜索句柄。如果出错，返回一个INVALID_HANDLE_VALUE常数，一旦不再需要，应该用FindClose函数关闭这个句柄
    .参数 lpFileName, 文本型, , 欲搜索的文件名。可包含通配符，并可包含一个路径或相对路径名
    .参数 lpFindFileData, WIN32_FIND_DATA, , WIN32_FIND_DATA，这个结构用于装载与找到的文件有关的信息。该结构可用于后续的搜索;

FindNextFile.Data:
.DLL命令 FindNextFile, 整数型, "kernel32", "FindNextFileA", 根据调用FindFirstFile函数时指定的一个文件名查找下一个文件　非零表示成功，零表示失败。如不再有与指定条件相符的文件，会将GetLastError设置成ERROR_NO_MORE_FILES
    .参数 hFindFile, 整数型, , 由FindFirstFile函数返回的搜索句柄
    .参数 lpFindFileData, WIN32_FIND_DATA, , WIN32_FIND_DATA，这个结构用于装载与找到的文件有关的信息;

FindWindow.Data:
.DLL命令 FindWindow, 整数型, "user32", "FindWindowA", 寻找窗口列表中第一个符合指定条件的顶级窗口（在vb里使用：FindWindow最常见的一个用途是获得ThunderRTMain类的隐藏窗口的句柄；该类是所有运行中vb执行程序的一部分。获得句柄后，可用api函数GetWindowText取得这个窗口的名称；该名也是应用程序的标题）　找到窗口的句柄。如未找到相符窗口，则返回零。会设置GetLastError
    .参数 lpClassName, 文本型, , 指向包含了窗口类名的空中止（C语言）字串的指针；或设为零，表示接收任何类
    .参数 lpWindowName, 文本型, , 指向包含了窗口文本（或标签）的空中止（C语言）字串的指针；或设为零，表示接收任何窗口标题  示例Dim hw&, cnt&Dim rttitle As  * 256hw& = FindWindow("ThunderRT5Main", vbNullString) ' ThunderRTMain under VB4cnt = GetWindowText(hw&, rttitle, 255)MsgBox Left$(rttitle, cnt), 0, "RTMain title";

FlashWindow.Data:
.DLL命令 FlashWindow, 整数型, "user32", "FlashWindow", 闪烁显示指定窗口。这意味着窗口的标题和说明文字会发生变化，似乎从活动切换到非活动状态、或反向切换。通常对不活动的窗口应用这个函数，引起用户的注意　如窗口在调用前处于活动状态，则返回TRUE（非零）
    .参数 hwnd, 整数型, , 要闪烁显示的窗口的句柄
    .参数 bInvert, 整数型, , TRUE（非零）表示切换窗口标题；FALSE返回最初状态;

FlushViewOfFile.Data:
.DLL命令 FlushViewOfFile, 整数型, "kernel32", "FlushViewOfFile", 将写入文件映射缓冲区的所有数据都刷新到磁盘　非零表示成功，零表示失败。会设置GetLastError
    .参数 lpBaseAddress, 整数型, , 包含了刷新基本地址的一个Long值（参考注解）
    .参数 dwNumberOfBytesToFlush, 整数型, , 欲刷新的字节数;

GetAspectRatioFilterEx.Data:
.DLL命令 GetAspectRatioFilterEx, 整数型, "gdi32", "GetAspectRatioFilterEx", 我们可用SetMapperFlags函数要求Windows只选择与设备当前纵横比相符的光栅字体。这个函数可判断那种特殊选择过程中使用的纵横比是多大　非零表示成功，零表示失败。会设置GetLastError
    .参数 hdc, 整数型, , 一个设备场景的句柄
    .参数 lpAspectRatio, SIZE, , SIZE，用于装载纵横比的一个结构;

GetBinaryType.Data:
.DLL命令 GetBinaryType, 整数型, "kernel32", "GetBinaryTypeA", 判断文件是否可以执行　非零表示成功，零表示失败
    .参数 lpApplicationName, 文本型, , 欲测试文件的完整路径名
    .参数 lpBinaryType, 整数型, , 用于装载文件类型的一个变量。这些类型由下述任何一个常数定义：;SCS_32BIT_BINARY：win32执行程序;SCS_DOS_BINARY：DOS执行程序;SCS_OS216_BINARY：16位OS/2执行程序;SCS_PIF_BINARY：用于执行DOS程序的一个pif文件;SCS_POSIX_BINARY：一个Posix应用;SCS_WOW_BINARY：16位windows执行程序;

GetBitmapDimensionEx.Data:
.DLL命令 GetBitmapDimensionEx, 整数型, "gdi32", "GetBitmapDimensionEx", 取得一幅位图的宽度和高度。它们是由SetBitmapDimensionEx函数设置的。Windows不会使用位图的大小　非零表示成功，零表示失败。会设置GetLastError
    .参数 hBitmap, 整数型, , 位图句柄
    .参数 lpDimension, SIZE, , SIZE，这个结构用于容纳由SetBitmapDimensionEx函数设置的位图的大小。这个大小以1mm的十分之一为单位;

GetBrushOrgEx.Data:
.DLL命令 GetBrushOrgEx, 整数型, "gdi32", "GetBrushOrgEx", 判断指定设备场景中当前选定刷子起点　非零表示成功，零表示失败。会设置GetLastError
    .参数 hDC, 整数型, , 设备场景的句柄
    .参数 lpPoint, POINTAPI, , POINTAPI，这个结构用来装载当前刷子的起点;

GetCPInfo.Data:
.DLL命令 GetCPInfo, 整数型, "kernel32", "GetCPInfo", 取得与指定代码页有关的信息　非零表示成功，零表示失败。会设置GetLastError
    .参数 CodePage, 整数型, , 欲为其载入信息的代码页的标识符。可能是一个ANSI或OEM代码页
    .参数 lpCPInfo, CPINFO, , CPINFO，用于容纳代码页信息的一个结构;

GetClassLong.Data:
.DLL命令 GetClassLong, 整数型, "user32", "GetClassLongA", 取得窗口类的一个Long变量条目　由nIndex决定。零表示出错。会设置GetLastError
    .参数 hwnd, 整数型, , 要为其获得类信息的窗口的句柄
    .参数 nIndex, 整数型, , 欲取得的信息，可能是下述任何一个常数：（正数表示一个字节偏移，用于取得在额外字节中为这个类分配的类信息）;GCL_CBCLSEXTRA：这个类结构中分配的额外字节数;GCL_CBWNDEXTRA：窗口结构里为这个类中每个窗口分配的额外字节数;GCL_HBRBACKGROUND：描绘这个类每个窗口的背景时，使用的默认刷子的句柄;GCL_HCURSOR：指向这个类窗口默认光标的句柄;GCL_HICON：这个类中窗口默认图标的句柄;GCL_HICONSM：这个类的小图标;GCL_HMODULE：这个类的模块的句柄;GCL_MENUNAME：为类菜单取得名称或资源ID;GCL_STYLE：这个类的样式;GCL_WNDPROC：取得类窗口函数（该类窗口的默认窗口函数）的地址;

GetClassWord.Data:
.DLL命令 GetClassWord, 整数型, "user32", "GetClassWord", 为窗口类取得一个整数变量　由nIndex决定。零表示出错。会设置GetLastError
    .参数 hwnd, 整数型, , 欲获得类信息的那个窗口的句柄
    .参数 nIndex, 整数型, , 类信息的正偏移量；这些信息是该类的额外字节中分配的;

GetClientRect.Data:
.DLL命令 GetClientRect, 整数型, "user32", "GetClientRect", 返回指定窗口客户区矩形的大小　非零表示成功，零表示失败。会设置GetLastError
    .参数 hwnd, 整数型, , 欲计算大小的目标窗口
    .参数 lpRect, RECT, , RECT，指定一个矩形，用客户区域的大小载入（以像素为单位）;

GetClipBox.Data:
.DLL命令 GetClipBox, 整数型, "gdi32", "GetClipBox", 获取完全包含指定设备场景剪裁区的最小矩形　返回下列常数之一，以描述所得剪裁区：;    COMPLEXREGION：区域边界互相交叠;    SIMPLEREGION：区域边界没有互相交叠;    NULLREGION：区域为空;    ERRORAPI：发生了错误
    .参数 hdc, 整数型, , 设备场景句柄 
    .参数 lpRect, RECT, , RECT，装载包含设备场景剪裁区的矩形;

GetClipRgn.Data:
.DLL命令 GetClipRgn, 整数型, "gdi32", "GetClipRgn", 获取设备场景当前剪裁区　下列常数之一：;    1――执行成功，剪裁区存在;    0――执行成功，没有定义剪裁区;    -1――出错
    .参数 hdc, 整数型, , 想要访问的设备场景剪裁区
    .参数 hRgn, 整数型, , 已存在的区域句柄。该区域将被设为设备场景当前剪裁区;

GetCompressedFileSize.Data:
.DLL命令 GetCompressedFileSize, 整数型, "kernel32", "GetCompressedFileSizeA", 判断一个压缩文件在磁盘上实际占据的字节数　返回文件长度。&HFFFFFFFF表示出错。注意如lpFileSizeHigh不为NULL，且结果为&HFFFFFFFF，那么必须调用GetLastError，判断是否实际发生了一个错误，因为这是一个有效的结果
    .参数 lpFileName, 文本型, , 欲测试的文件名
    .参数 lpFileSizeHigh, 整数型, , 指定一个Long值，用于装载一个64位文件尺寸的高32位。如长度没有超过2＾32字节，则可设为NULL（变成ByVal）;

GetComputerName.Data:
.DLL命令 GetComputerName, 整数型, "kernel32", "GetComputerNameA", 取得这台计算机的名称　TRUE（非零）表示成功，否则返回零。会设置GetLastError
    .参数 lpBuffer, 文本型, , 随同计算机名载入的字串缓冲区
    .参数 nSize, 整数型, , 缓冲区的长度。这个变量随同返回计算机名的实际长度载入  示例Dim s$s$ = $(MAX_COMPUTERNAME_LENGTH+1,0)Dim dl&Dim sz&sz& = MAX_COMPUTERNAME_LENGTH+1dl& = GetComputerName(s$, sz)其他也许你会发现，MAX_COMPUTERNAME_LENGTH常数在vb自带的api文本查看器中找不到。的确，我也没有找到。但我有一个工具：Listapi，这个常数在它那里可以找到;

GetCurrentDirectory.Data:
.DLL命令 GetCurrentDirectory, 整数型, "kernel32", "GetCurrentDirectoryA", 在一个缓冲区中装载当前目录　装载到lpBuffer的字节数。如nBufferLength的长度不够，不足以容纳目录，则返回值是必要的缓冲区长度（要求至少这个长度），其中包括空中止字符。零表示失败。会设置GetLastError
    .参数 nBufferLength, 整数型, , lpBuffer缓冲区的长度
    .参数 lpBuffer, 文本型, , 指定一个预定义字串，用于装载当前目录;

GetCurrentObject.Data:
.DLL命令 GetCurrentObject, 整数型, "gdi32", "GetCurrentObject", 用于获得指定类型的当前选定对象　当前选定对象的句柄，零表示错误
    .参数 hdc, 整数型, , 欲查询的设备场景
    .参数 uObjectType, 整数型, , 对象类型。可以是下述常数之一：OBJ_PEN，OBJ_BRUSH，OBJ_PAL，OBJ_FONT，或OBJ_BITMAP;

GetCurrentPositionEx.Data:
.DLL命令 GetCurrentPositionEx, 整数型, "gdi32", "GetCurrentPositionEx", 在指定的设备场景中取得当前的画笔位置　非零表示成功，零表示失败
    .参数 hdc, 整数型, , 设备场景的句柄
    .参数 lpPoint, POINTAPI, , POINTAPI，用于装载当前位置;

GetDCOrgEx.Data:
.DLL命令 GetDCOrgEx, 整数型, "gdi32", "GetDCOrgEx", 获取指定设备场景起点位置（以屏幕坐标表示）。例如，设DC起点为窗口客户区左上角，则该函数返回值为该角在屏幕中的位置（以屏幕像素坐标表示）　执行成功为非零值，否则为零
    .参数 hdc, 整数型, , 设备场景句柄
    .参数 lpPoint, POINTAPI, , POINTAPI，装载设备场景起点的屏幕坐标示例：在窗体模块中使用时，该代码装载窗体客户区左上角坐标（以屏幕坐标表示）。它也是窗体hDC属性的起点Dim dl&Dim pt As POINTAPIdl& = GetDCOrgEx(hDC, pt);

GetDeviceCaps.Data:
.DLL命令 GetDeviceCaps, 整数型, "gdi32", "GetDeviceCaps", 根据指定设备场景代表的设备的功能返回信息　参见GetDeviceCaps索引表
    .参数 hdc, 整数型, , 要查询其设备的信息的设备场景
    .参数 nIndex, 整数型, , 根据GetDeviceCaps索引表所示常数确定返回信息的类型;

GetExitCodeProcess.Data:
.DLL命令 GetExitCodeProcess, 整数型, "kernel32", "GetExitCodeProcess", 获取一个已中断进程的退出代码　非零表示成功，零表示失败。会设置GetLastError
    .参数 hProcess, 整数型, , 想获取退出代码的一个进程的句柄
    .参数 lpExitCode, 整数型, , 用于装载进程退出代码的一个长整数变量。如进程尚未中止，则设为常数STILL_ACTIVE;

GetExitCodeThread.Data:
.DLL命令 GetExitCodeThread, 整数型, "kernel32", "GetExitCodeThread", 获取一个已中止线程的退出代码　非零表示成功，零表示失败。会设置GetLastError
    .参数 hThread, 整数型, , 想获取退出代码的一个线程的句柄
    .参数 lpExitCode, 整数型, , 用于装载线程退出代码的一个长整数变量。如线程尚未中断，则设为常数STILL_ACTIVE;

GetExpandedName.Data:
.DLL命令 GetExpandedName, 整数型, "lz32.dll", "GetExpandedNameA", 取得一个压缩文件的全名。文件必须是用 ;    COMPRESS.EXE 程序压缩的，而且在压缩时适用/r选项　1表示成功，LZERROR_BADVALUE 表示失败
    .参数 lpszSource, 文本型, , 压缩文件的名字
    .参数 lpszBuffer, 文本型, , 指定一个缓冲区，用于装载文件全名;

GetFileInformationByHandle.Data:
.DLL命令 GetFileInformationByHandle, 整数型, "kernel32", "GetFileInformationByHandle", 这个函数提供了获取文件信息的一种机制――在一个BY_HANDLE_FILE_INFORMATION结构中装载与文件有关的信息　非零表示成功，零表示失败。会设置GetLastError
    .参数 hFile, 整数型, , 文件的句柄
    .参数 lpFileInformation, BY_HANDLE_FILE_INFORMATION, , BY_HANDLE_FILE_INFORMATION，用于容纳文件信息的结构;

GetFileSize.Data:
.DLL命令 GetFileSize, 整数型, "kernel32", "GetFileSize", 判断文件长度　返回文件长度。&HFFFFFFFF表示出错。注意如lpFileSizeHigh不为NULL，且结果为&HFFFFFFFF，那么必须调用GetLastError，判断是否实际发生了一个错误，因为这是一个有效的结果
    .参数 hFile, 整数型, , 文件的句柄
    .参数 lpFileSizeHigh, 整数型, , 指定一个长整数，用于装载一个64位文件长度的头32位。如这个长度没有超过2＾32字节，则该参数可以设为NULL（变成ByVal）;

GetFileVersionInfoSize.Data:
.DLL命令 GetFileVersionInfoSize, 整数型, "version.dll", "GetFileVersionInfoSizeA", 针对包含了版本资源的一个文件，判断容纳文件版本信息需要一个多大的缓冲区　容纳文件的版本资源所需的缓冲区长度。如文件不包含版本信息，则返回一个0值。会设置GetLastError
    .参数 lptstrFilename, 文本型, , 包含了版本资源的一个文件的名字
    .参数 lpdwHandle, 整数型, , 在这个变量中载入0值;

GetHandleInformation.Data:
.DLL命令 GetHandleInformation, 整数型, "kernel32", "GetHandleInformation", 获取与一个系统对象句柄有关的信息　非零表示成功，零表示失败。会设置GetLastError
    .参数 hObject, 整数型, , 要测试的句柄
    .参数 lpdwFlags, 整数型, , 设置了下述一个或多个常数的位标志：;HANDLE_FLAG_INHERIT：对象可由一个子进程继承;HANDLE_FLAG_PROTECT_FROM_CLOSE：句柄不可用CloseHandle函数关闭适用平台Windows NT;

GetIconInfo.Data:
.DLL命令 GetIconInfo, 整数型, "user32", "GetIconInfo", 取得与图标有关的信息　非零表示成功，零表示失败。会设置GetLastError
    .参数 hIcon, 整数型, , 图标句柄
    .参数 piconinfo, ICONINFO, , ICONINFO，这个结构装载的信息与包含了XOR及AND位图的图标有关;

GetKeyboardLayoutList.Data:
.DLL命令 GetKeyboardLayoutList, 整数型, "user32", "GetKeyboardLayoutList", 获得系统适用的所有键盘布局的一个列表　装载到内存的键盘布局的数量
    .参数 nBuff, 整数型, , lpList数组中的条目数量。如设为零，表示获取可用键盘布局的数量
    .参数 lpList, 整数型, , 指定一个数组，它的元素数量至少应有nBuff规定的元素那么多。这个数组会随同句柄载入可用的键盘布局;

GetLogicalDriveStrings.Data:
.DLL命令 GetLogicalDriveStrings, 整数型, "kernel32", "GetLogicalDriveStringsA", 获取一个字串，其中包含了当前所有逻辑驱动器的根驱动器路径　装载到lpBuffer的字符数量（排除空中止字符）。如缓冲区的长度不够，不能容下路径，则返回值就变成要求的缓冲区大小。零表示失败。会设置GetLastError
    .参数 nBufferLength, 整数型, , lpBuffer字串的长度
    .参数 lpBuffer, 文本型, , 用于装载逻辑驱动器名称的字串。每个名字都用一个NULL字符分隔，在最后一个名字后面用两个NULL表示中止（空中止）;

GetMenuItemID.Data:
.DLL命令 GetMenuItemID, 整数型, "user32", "GetMenuItemID", 返回位于菜单中指定位置处的条目的菜单ID　指定条目的菜单ID。如条目属于一个弹出式菜单，就返回-1；如指定的条目属于一个分隔符（比如一条分隔线）则返回0
    .参数 hMenu, 整数型, , 菜单的句柄
    .参数 nPos, 整数型, , 条目在菜单中的位置。第一个条目的编号是0;

GetMiterLimit.Data:
.DLL命令 GetMiterLimit, 整数型, "gdi32", "GetMiterLimit", 取得设备场景的斜率限制（Miter）设置――斜率限制是指斜角长度与线宽间的比率　
    .参数 hdc, 整数型, , 设备场景的句柄
    .参数 peLimit, 双精度小数型, , Single，随同当前斜率设置载入一个Single值;

GetNearestColor.Data:
.DLL命令 GetNearestColor, 整数型, "gdi32", "GetNearestColor", 根据设备的显示能力，取得与指定颜色最接近的一种纯色　取得与指定颜色最接近的一种颜色，这种颜色可由设备场景实际显示出来（给定当前系统调色板）。如返回CLR_INVALID，表示函数执行出错。会设置GetLastError
    .参数 hdc, 整数型, , 设备场景的句柄
    .参数 crColor, 整数型, , 欲测试的RGB颜色;

GetPixel.Data:
.DLL命令 GetPixel, 整数型, "gdi32", "GetPixel", 在指定的设备场景中取得一个像素的RGB值　指定点的RGB颜色。如指定的点位于设备场景的剪切区之外，则返回CLR_INVALID
    .参数 hdc, 整数型, , 一个设备场景的句柄
    .参数 x, 整数型, , 逻辑坐标中要检查的点;  
    .参数 y, 整数型, , 同上;

GetProcessShutdownParameters.Data:
.DLL命令 GetProcessShutdownParameters, 整数型, "kernel32", "GetProcessShutdownParameters",  ;     调查系统关闭时一个指定的进程相对于其它进程的关闭早迟情况　非零表示成功，零表示失败。
    .参数 lpdwLevel, 整数型, , 从0到&H4FF的一个值。编号越高程序在系统关闭时越早关闭。
    .参数 lpdwFlags, 整数型, , 指定SHUTDOWN_NORETRY标志。如关闭一个进程时，会出现一个重试对话框。通过设置这个标志，就可以禁止那个对话框出现，并直接关闭进程适用平台 Wnidows NT;

GetRasterizerCaps.Data:
.DLL命令 GetRasterizerCaps, 整数型, "gdi32", "GetRasterizerCaps", 了解系统是否有能力支持可缩放的字体。利用得到的结果，可判断那种系统中是否允许使用TureType字体　非零表示成功，零表示失败。会设置GetLastError
    .参数 lpraststat, RASTERIZER_STATUS, , RASTERIZER_STATUS，这个结构用于装载光栅信息
    .参数 cb, 整数型, , 欲复制到结构中的字符数;

GetRgnBox.Data:
.DLL命令 GetRgnBox, 整数型, "gdi32", "GetRgnBox", 获取完全包含指定区域的最小矩形　下列常数之一，以描述当前剪裁区：;    COMPLEXREGION：该区域有互相交叠的边界;    SIMPLEREGION：该区域边界没有互相交叠;    NULLREGION：区域为空;    ERRORAPI：发生了错误
    .参数 hRgn, 整数型, , 区域句柄
    .参数 lpRect, RECT, , RECT，矩形结构，装载完全包含指定区域的矩形;

GetSubMenu.Data:
.DLL命令 GetSubMenu, 整数型, "user32", "GetSubMenu", 取得一个弹出式菜单的句柄，它位于菜单中指定的位置　位于指定位置的弹出式菜单的句柄（如果有的话）；否则返回零
    .参数 hMenu, 整数型, , 菜单的句柄
    .参数 nPos, 整数型, , 条目在菜单中的位置。第一个条目的编号为0;

GetSystemDirectory.Data:
.DLL命令 GetSystemDirectory, 整数型, "kernel32", "GetSystemDirectoryA", 这个函数能取得Windows系统目录（System目录）的完整路径名。在这个目录中，包含了所有必要的系统文件。根据微软的标准，其他定制控件和一些共享组件也可放到这个目录。通常应避免在这个目录里创建文件。在网络环境中，往往需要管理员权限才可对这个目录进行写操作　装载到lpBuffer缓冲区的字符数量。如lpBuffer不够大，不能容下文件名，则返回要求的缓冲区长度
    .参数 lpBuffer, 文本型, , 用于装载系统目录路径名的一个字串缓冲区。它应事先初始化成nSize+1个字符的长度。通常至少要为这个缓冲区分配MAX_PATH个字符的长度
    .参数 nSize, 整数型, , lpBuffer字串的最大长度;

GetSystemMenu.Data:
.DLL命令 GetSystemMenu, 整数型, "user32", "GetSystemMenu", 取得指定窗口的系统菜单的句柄。在vb环境，“系统菜单”的正式名称为“控制菜单”，即单击窗口左上角的控制框时出现的菜单　如执行成功，返回系统菜单的句柄；零意味着出错。如bRevert设为TRUE，也会返回零（简单的恢复原始的系统菜单）
    .参数 hwnd, 整数型, , 窗口的句柄
    .参数 bRevert, 整数型, , 如设为TRUE，表示接收原始的系统菜单;

GetTempPath.Data:
.DLL命令 GetTempPath, 整数型, "kernel32", "GetTempPathA", 获取为临时文件指定的路径　装载到lpBuffer的字符数。如当前缓冲区的长度不够，不能容下整个路径，则返回lpBuffer需要的长度。零表示失败。会设置GetLastError
    .参数 nBufferLength, 整数型, , lpBuffer字串的长度
    .参数 lpBuffer, 文本型, , 用于装载临时文件路径的一个预初始化字串;

GetTextMetrics.Data:
.DLL命令 GetTextMetrics, 整数型, "gdi32", "GetTextMetricsA", 获取与选入一种设备场景的物理字体有关的信息　非零表示成功，零表示失败。会设置GetLastError
    .参数 hdc, 整数型, , 设备场景的句柄
    .参数 lpMetrics, TEXTMETRIC, , TEXTMETRIC，用于填充物理字体属性信息的一个结构;

GetUserName.Data:
.DLL命令 GetUserName, 整数型, "advapi32.dll", "GetUserNameA", 取得当前用户的名字　TRUE（非零）表示成功，否则返回零。会设置GetLastError
    .参数 lpBuffer, 文本型, , 一个字串缓冲区，预先初始化成由nSize指定的长度。它将用于容纳用户名
    .参数 nSize, 整数型, , 初始化成lpBuffer的长度。返回以后，它会包含载入lpBuffer的字符数量示例Dim s$, cnt&, dl&cnt& = 199s$ = $(200,0)dl& = GetUserName(s$, cnt)Debug.Print Left$(s$, cnt); cnt;

GetViewportExtEx.Data:
.DLL命令 GetViewportExtEx, 整数型, "gdi32", "GetViewportExtEx", 获取设备场景视口（viewport）范围　执行成功为非零值，失败为0
    .参数 hdc, 整数型, , 设备场景句柄
    .参数 lpSize, SIZE, , SIZE，装载DC视口水平和垂直范围（以设备单元表示）的结构;

GetViewportOrgEx.Data:
.DLL命令 GetViewportOrgEx, 整数型, "gdi32", "GetViewportOrgEx", 获取设备场景视口起点　执行成功为非零值，失败为0
    .参数 hdc, 整数型, , 设备场景句柄
    .参数 lpPoint, POINTAPI, , POINTAPI，装载视口起点的结构;

GetWindow.Data:
.DLL命令 GetWindow, 整数型, "user32", "GetWindow", 获得一个窗口的句柄，该窗口与某源窗口有特定的关系　由wCmd决定的一个窗口的句柄。如没有找到相符窗口，或者遇到错误，则返回零值。会设置GetLastError
    .参数 hwnd, 整数型, , 源窗口
    .参数 wCmd, 整数型, , 指定结果窗口与源窗口的关系，它们建立在下述常数基础上：;GW_CHILD：寻找源窗口的第一个子窗口;GW_HWNDFIRST：为一个源子窗口寻找第一个兄弟（同级）窗口，或寻找第一个顶级窗口;GW_HWNDLAST：为一个源子窗口寻找最后一个兄弟（同级）窗口，或寻找最后一个顶级窗口;GW_HWNDNEXT：为源窗口寻找下一个兄弟窗口;GW_HWNDPREV：为源窗口寻找前一个兄弟窗口;GW_OWNER：寻找窗口的所有者;

GetWindowExtEx.Data:
.DLL命令 GetWindowExtEx, 整数型, "gdi32", "GetWindowExtEx", 获取指定设备场景的窗口范围　执行成功为非零值，失败为0
    .参数 hdc, 整数型, , 设备场景句柄
    .参数 lpSize, SIZE, , SIZE，装载设备场景逻辑窗口水平和垂直范围（以逻辑单元表示）的结构;

GetWindowLong.Data:
.DLL命令 GetWindowLong, 整数型, "user32", "GetWindowLongA", 从指定窗口的结构中取得信息　由nIndex决定。零表示出错。会设置GetLastError
    .参数 hwnd, 整数型, , 欲为其获取信息的窗口的句柄
    .参数 nIndex, 整数型, , 欲取回的信息，可以是下述任何一个常数：;GWL_EXSTYLE：扩展窗口样式;GWL_STYLE：窗口样式;GWL_WNDPROC：该窗口的窗口函数的地址;GWL_HINSTANCE：拥有窗口的实例的句柄;GWL_HWNDPARENT：该窗口之父的句柄。不要用SetWindowWord来改变这个值;GWL_ID：对话框中一个子窗口的标识符;GWL_USERDATA：含义由应用程序规定;DWL_DLGPROC：这个窗口的对话框函数地址;DWL_MSGRESULT：在对话框函数中处理的一条消息返回的值;DWL_USER：含义由应用程序规定;

GetWindowOrgEx.Data:
.DLL命令 GetWindowOrgEx, 整数型, "gdi32", "GetWindowOrgEx", 获取指定设备场景的逻辑窗口的起点　执行成功为非零值，失败为0
    .参数 hdc, 整数型, , 设备场景句柄
    .参数 lpPoint, POINTAPI, , POINTAPI，装载逻辑窗口起点的结构;

GetWindowPlacement.Data:
.DLL命令 GetWindowPlacement, 整数型, "user32", "GetWindowPlacement", 获得指定窗口的状态及位置信息　非零表示成功，零表示失败。会设置GetLastError
    .参数 hwnd, 整数型, , 欲获取信息的那个窗口的句柄
    .参数 lpwndpl, WINDOWPLACEMENT, , WINDOWPLACEMENT，包含的窗口位置和状态信息的结构;

GetWindowRect.Data:
.DLL命令 GetWindowRect, 整数型, "user32", "GetWindowRect", 获得整个窗口的范围矩形，窗口的边框、标题栏、滚动条及菜单等都在这个矩形内　非零表示成功，零表示失败。会设置GetLastError
    .参数 hwnd, 整数型, , 想获得范围矩形的那个窗口的句柄
    .参数 lpRect, RECT, , RECT，屏幕坐标中随同窗口装载的矩形;

GetWindowRgn.Data:
.DLL命令 GetWindowRgn, 整数型, "user32", "GetWindowRgn", 根据以前 SetWindowRgn 函数的定义获取窗口区域　下列常数之一，以描述当前剪裁区：;    COMPLEXREGION：该区域有互相交叠的边界;    SIMPLEREGION：该区域边界没有互相交叠;    NULLREGION：区域为空;    ERRORAPI：发生了错误
    .参数 hWnd, 整数型, , 要获取区域的窗口
    .参数 hRgn, 整数型, , 区域句柄，若已设置有一个区域，则装载当前窗口区域的拷贝;

GetWindowWord.Data:
.DLL命令 GetWindowWord, , "user32", "GetWindowWord", 获得指定窗口结构的信息　由nIndex决定
    .参数 hwnd, 整数型, , 想获取信息的那个窗口的句柄
    .参数 nIndex, 整数型, , 正偏移值，指出在窗口额外字节分配的空间中取得的信息;

GetWindowsDirectory.Data:
.DLL命令 GetWindowsDirectory, 整数型, "kernel32", "GetWindowsDirectoryA", 这个函数能获取Windows目录的完整路径名。在这个目录里，保存了大多数windows应用程序文件及初始化文件　复制到lpBuffer的一个字串的长度。如lpBuffer不够大，不能容下整个字串，就会返回lpBuffer要求的长度。零表示失败。会设置GetLastError
    .参数 lpBuffer, 文本型, , 指定一个字串缓冲区，用于装载Windows目录名。除非是根目录，否则目录中不会有一个中止用的“\”字符
    .参数 nSize, 整数型, , lpBuffer字串的最大长度;

GetWorldTransform.Data:
.DLL命令 GetWorldTransform, 整数型, "gdi32", "GetWorldTransform", 如果有世界转换，为设备场景获取当前世界转换　执行成功为非零值，失败为0
    .参数 hdc, 整数型, , 设备场景句柄
    .参数 lpXform, xform, , xform，装载设备场景当前世界转换的结构适用平台Windows NT;

InvertRect.Data:
.DLL命令 InvertRect, 整数型, "user32", "InvertRect", 通过反转每个像素的值，从而反转一个设备场景中指定的矩形　非零表示成功，零表示失败。会设置GetLastError
    .参数 hdc, 整数型, , 设备场景的句柄
    .参数 lpRect, RECT, , RECT，要反转的矩形，用逻辑坐标指定;

InvertRgn.Data:
.DLL命令 InvertRgn, 整数型, "gdi32", "InvertRgn", 通过颠倒每个像素值反转设备场景指定区域　执行成功为非零值，失败为零
    .参数 hdc, 整数型, , 设备场景句柄
    .参数 hRgn, 整数型, , 将反转的设备区域;

IsChild.Data:
.DLL命令 IsChild, 整数型, "user32", "IsChild", 判断一个窗口是否为另一窗口的子或隶属窗口　非零表示成功，零表示失败
    .参数 hWndParent, 整数型, , 父窗口的句柄
    .参数 hwnd, 整数型, , 欲测试的窗口的句柄;

IsValidLocale.Data:
.DLL命令 IsValidLocale, 整数型, "KERNEL32", "IsValidLocale", 判断地方标识符是否有效　根据测试条件，如指定的地方有效，就返回TRUE（非零）；否则返回零
    .参数 Locale, 整数型, , 要检查的地方标识符
    .参数 dwFlags, 整数型, , 下述常数之一：;LCID_SUPPORTED：检查“地方”是否能由系统支持;LCID_INSTALLED：检查“地方”是否已获支持并安装;

LZCopy.Data:
.DLL命令 LZCopy, 整数型, "lz32.dll", "LZCopy", 复制一个文件。如源文件已压缩，则会在复制期间解压。文件必须是用微软公司的compress.exe或等效工具压缩的　如执行成功，返回目标文件的大小，以字节为单位。如执行出错，会返回小于零的一个常数，如下表
    .参数 hfSource, 整数型, , 指定源文件句柄。这是由LZOpenFile 或 LZInit函数返回的一个句柄
    .参数 hfDest, 整数型, , 指定目标文件句柄。这是由LZOpenFile 或 LZInit函数返回的一个句柄;

LineTo.Data:
.DLL命令 LineTo, 整数型, "gdi32", "LineTo", 用当前画笔画一条线，从当前位置连到一个指定的点。这个函数调用完毕，当前位置变成x,y点　非零表示成功，零表示失败
    .参数 hdc, 整数型, , 设备场景的句柄
    .参数 x, 整数型, , 线段终点位置，采用逻辑坐标表示。这个点不会实际画出来；它不属于线段的一部分;  
    .参数 y, 整数型, , 同上;

LoadBitmap.Data:
.DLL命令 LoadBitmap, 整数型, "user32", "LoadBitmapA", 从指定的模块或应用程序实例中载入一幅位图。LoadBitmapBynum是LoadBitmap函数的类型安全声明　已载入的位图的句柄，零表示失败。会设置GetLastError
    .参数 hInstance, 整数型, , 一个DLL的模块句柄；或者一个实例句柄，它指定了包含位图的可执行文件
    .参数 lpBitmapName, 文本型, , 作为一个字串，指定欲载入的位图资源。作为一个长整数，指定欲载入的资源ID。或者一个常数，代表某幅固有系统位图。如装载一幅固有系统位图，hInstance参数应设为0。常数在api32.txt文件中用前缀 OBM_ 标志。OBM_REDUCE 引用的是标题栏右侧显示的下箭头位图，用于最小化一个窗口。参考api32.txt，其中有系统固有位图的完整列表;

LoadCursor.Data:
.DLL命令 LoadCursor, 整数型, "user32", "LoadCursorA", 从指定的模块或应用程序实例中载入一个鼠标指针。LoadCursorBynum是LoadCursor函数的类型安全声明　执行成功则返回已载入的指针的句柄；零表示失败。在Windows ;    95 和Win16环境中，这个函数只能载入标准尺寸的图标
    .参数 hInstance, 整数型, , 一个DLL的模块句柄；或者一个实例句柄，指定包含了鼠标指针的可执行程序
    .参数 lpCursorName, 文本型, , 作为一个字串，指定欲载入的指针资源。作为一个长整数值，指定欲载入的资源ID；或者设置一个常数，代表某幅固有系统指针。如装载的是一个固有系统指针，注意hInstance参数应设为零。在api32.txt文件中以前缀IDC_ 作为标志;

LoadMenu.Data:
.DLL命令 LoadMenu, 整数型, "user32", "LoadMenuA", 从指定的模块或应用程序实例中载入一个菜单　已装载的菜单的句柄；零意味着出错。会设置GetLastError
    .参数 hInstance, 整数型, , 一个动态链接库的模块句柄。或指定了特定可执行文件的一个实例句柄，那个可执行文件中包含了菜单资源
    .参数 lpString, 文本型, , 作为字串使用时，指定欲载入的菜单资源的名字；作为Long值使用时，指定欲载入的菜单ID。;

LoadModule.Data:
.DLL命令 LoadModule, 整数型, "kernel32", "LoadModule",  载入一个windows应用程序，并在指定的环境中运行　大于32表示成功，请参考FindExecutable函数的返回值
    .参数 lpModuleName, 文本型, , ，要装载的可执行程序的文件名
    .参数 lpParameterBlock, 整数型, , 指定一个结构，用它定义装载新应用程序时使用的参数;

MapVirtualKey.Data:
.DLL命令 MapVirtualKey, 整数型, "user32", "MapVirtualKeyA", 根据指定的映射类型，执行不同的扫描码和字符转换　取决于wMapType参数
    .参数 wCode, 整数型, , 欲转换的源字符或扫描码
    .参数 wMapType, 整数型, , 控制映射类型，如下所示0―― wCode是个虚拟键码。函数返回相应的扫描码1―― wCode是个扫描码。函数返回相应的虚拟键码2―― wCode是个虚拟键码。函数返回相应的ASCII值（未加Shift组合键）;

PaintRgn.Data:
.DLL命令 PaintRgn, 整数型, "gdi32", "PaintRgn", 用当前刷子背景色填充指定区域　执行成功为非零值，失败为0
    .参数 hdc, 整数型, , 设备场景句柄
    .参数 hRgn, 整数型, , 将填充的区域句柄;

PlayMetaFile.Data:
.DLL命令 PlayMetaFile, 整数型, "gdi32", "PlayMetaFile", 在指定的设备场景中回放一个图元文件。图元文件中记录的GDI操作会针对设备场景而执行　
    .参数 hdc, 整数型, , 要在其中回放图元文件的一个设备场景的句柄
    .参数 hMF, 整数型, , 欲回放的一个图元文件的句柄;

PrinterProperties.Data:
.DLL命令 PrinterProperties, 整数型, "winspool.drv", "PrinterProperties", 启动打印机属性对话框，以便对打印机进行配置　非零表示成功，零表示失败。会设置GetLastError
    .参数 hwnd, 整数型, , 对话框的父窗口
    .参数 hPrinter, 整数型, , 一个已打开的打印机的句柄;

RectInRegion.Data:
.DLL命令 RectInRegion, 整数型, "gdi32", "RectInRegion", 确定矩形是否有部分在指定区域内　若矩形有部分在指定区域内为非零值，否则为0
    .参数 hRgn, 整数型, , 区域句柄
    .参数 lpRect, RECT, , RECT，要测试的矩形结构;

RectVisible.Data:
.DLL命令 RectVisible, 整数型, "gdi32", "RectVisible", 确定指定矩形是否有部分可见（是否在设备场景剪裁区内）　矩形有部分在指定设备场景剪裁区内为非零值，否则为零
    .参数 hdc, 整数型, , 设备场景句柄
    .参数 lpRect, RECT, , RECT，用于测试是否可见的矩形（用逻辑坐标）;

RegDeleteKey.Data:
.DLL命令 RegDeleteKey, 整数型, "advapi32.dll", "RegDeleteKeyA", 删除现有项下方一个指定的子项　零（ERROR_SUCCESS）表示成功。其他任何值都代表一个错误代码
    .参数 hKey, 整数型, , 一个已打开项的句柄，或者标准项名之一
    .参数 lpSubKey, 文本型, , 要删除项的名字。这个项的所有子项也会删除;

RegDeleteValue.Data:
.DLL命令 RegDeleteValue, 整数型, "advapi32.dll", "RegDeleteValueA", 删除指定项下方的一个值　零（ERROR_SUCCESS）表示成功。其他任何值都代表一个错误代码
    .参数 hKey, 整数型, , 一个已打开项的句柄，或标准项名之一
    .参数 lpValueName, 文本型, , 要删除的值名。可设为vbNull或一个空串，表示删除那个项的默认值;

RegUnLoadKey.Data:
.DLL命令 RegUnLoadKey, 整数型, "advapi32.dll", "RegUnLoadKeyA", 卸载指定的项以及它的所有子项　零（ERROR_SUCCESS）表示成功。其他任何值都代表一个错误代码
    .参数 hKey, 整数型, , HKEY_LOCAL_MACHINE、HKEY_USERS或者用RegConnectRegistry打开的一个子项
    .参数 lpSubKey, 文本型, , 要卸载的子项的名字。必须是早先用RegLoadKey函数载入的;

ReleaseDC.Data:
.DLL命令 ReleaseDC, 整数型, "user32", "ReleaseDC", 释放由调用GetDC或GetWindowDC函数获取的指定设备场景。它对类或私有设备场景无效（但这样的调用不会造成损害）　执行成功为1，否则为0
    .参数 hwnd, 整数型, , 要释放的设备场景相关的窗口句柄
    .参数 hdc, 整数型, , 要释放的设备场景句柄;

ResetDC.Data:
.DLL命令 ResetDC, 整数型, "gdi32", "ResetDCA", 根据提供的DEVMODE结构，对一个设备场景进行重设。这样便允许我们在打印期间改变打印机的配置。利用这个函数，可将文档中的某个页改为横向打印。可试着用DocumentProperties函数取得一个设备的默认DEVMODE结构　执行成功则返回设备场景的句柄，零表示失败
    .参数 hdc, 整数型, , 设备场景的句柄
    .参数 lpInitData, DEVMODE, , DEVMODE，指定一个缓冲区的第一个字节。该缓冲区包含了用于那个设备的一个有效DEVMODE结构。记住在这个缓冲区中包括设备专用的数据区;

ResetPrinter.Data:
.DLL命令 ResetPrinter, 整数型, "winspool.drv", "ResetPrinterA", 改变指定打印机的默认数据类型及文档设置　非零表示成功，零表示失败。会设置GetLastError
    .参数 hPrinter, 整数型, , 欲修改的一台打印机的句柄
    .参数 pDefault, PRINTER_DEFAULTS, , PRINTER_DEFAULTS，定义了打印机新设置的一个结构。参考OpenPrinter函数的说明，了解这个结构进一步的细节。结构中的DesiredAccess字段会被忽略适用平台Windows NT;

RestoreDC.Data:
.DLL命令 RestoreDC, 整数型, "gdi32", "RestoreDC", 从设备场景堆栈恢复一个原先保存的设备场景　执行成功为非零值，失败为0
    .参数 hdc, 整数型, , 将恢复的设备场景句柄
    .参数 nSavedDC, 整数型, , 将恢复的设备场景ID号，它由SaveDC函数返回。若为-1，则恢复最近的设备场景;

ScheduleJob.Data:
.DLL命令 ScheduleJob, 整数型, "winspool.drv", "ScheduleJob", 提交一个要打印的作业　非零表示成功，零表示失败。会设置GetLastError
    .参数 hPrinter, 整数型, , 一台已打开的打印机句柄
    .参数 JobId, 整数型, , 以前用AddJob函数获得的作业编号;

ScreenToClient.Data:
.DLL命令 ScreenToClient, 整数型, "user32", "ScreenToClient", 判断屏幕上一个指定点的客户区坐标　非零表示成功，零表示失败
    .参数 hwnd, 整数型, , 一个窗口的句柄，该窗口定义了要使用的客户区坐标系统
    .参数 lpPoint, POINTAPI, , POINTAPI，屏幕坐标系统中包含了屏幕点的结构。这个函数会随同相应的客户区坐标（由hwnd决定）载入结构;

SelectClipPath.Data:
.DLL命令 SelectClipPath, 整数型, "gdi32", "SelectClipPath", 将设备场景当前的路径合并到剪切区域里　非零表示成功，零表示失败。会将GetLastError设置为下述值之一：ERROR_CAN_NOT_COMPLETE，ERROR_INVALID_PARAMETER，ERROR_NOT_ENOUGH_MEMORY
    .参数 hdc, 整数型, , 包含了欲合并到剪切区域的路径的一个设备场景的句柄
    .参数 iMode, 整数型, , 决定如何将路径与当前剪切区域合并到一起。可选下述常数之一：RGN_AND：新的剪切区域只包含了在路径和当前剪切区域都存在的点RGN_COPY：新剪切区域设为路径RGN_DIFF：新剪切区域只包含了当前剪切区域的点，但这些点不在路径中RGN_OR：新的剪切区域包含了在路径或当前剪切区域中的点RGN_XOR：新的剪切区域只包含了存在于路径或当前剪切区域中的点，但两地共有的点不包括在内;

SelectClipRgn.Data:
.DLL命令 SelectClipRgn, 整数型, "gdi32", "SelectClipRgn", 为指定设备场景选择新的剪裁区　下列常数之一，以描述当前剪裁区：;    COMPLEXREGION：该区域有互相交叠的边界;    SIMPLEREGION：该区域边界没有互相交叠;    NULLREGION：区域为空;    ERRORAPI：发生了错误（保留原有剪裁区）
    .参数 hdc, 整数型, , 将设置新剪裁区的设备场景
    .参数 hRgn, 整数型, , 将为设备场景设置剪裁区的句柄，该区域使用设备坐标;

SelectObject.Data:
.DLL命令 SelectObject, 整数型, "gdi32", "SelectObject", 每个设备场景都可能有选入其中的图形对象。其中包括位图、刷子、字体、画笔以及区域等等。一次选入设备场景的只能有一个对象。选定的对象会在设备场景的绘图操作中使用。例如，当前选定的画笔决定了在设备场景中描绘的线段颜色及样式　与以前选入设备场景的相同hObject类型的一个对象的句柄，零表示出错。如选定的对象是一个区域（Region），结果就是下列常数之一：SIMPLEREGION， ;    COMPLEXREGION 或 NULLREGION 对区域进行描述， GDI_ERROR 表示出错
    .参数 hdc, 整数型, , 一个设备场景的句柄
    .参数 hObject, 整数型, , 一个画笔、位图、刷子、字体或区域的句柄;

ShowOwnedPopups.Data:
.DLL命令 ShowOwnedPopups, 整数型, "user32", "ShowOwnedPopups", 显示或隐藏由指定窗口所有的全部弹出式窗口（在vb里使用：并不特别有用，因为vb不用弹出式窗口）　非零表示成功，零表示失败。会设置GetLastError
    .参数 hwnd, 整数型, , 父窗口的句柄
    .参数 fShow, 整数型, , TRUE（非零）表示显示由hwnd所有的所有弹出式窗口；FALSE（零）则隐藏它们;

ShowWindow.Data:
.DLL命令 ShowWindow, 整数型, "user32", "ShowWindow", 控制窗口的可见性（在vb里使用：针对vb窗体及控件，请使用对应的vb属性）　如窗口之前是可见的，则返回TRUE（非零），否则返回FALSE（零）
    .参数 hwnd, 整数型, , 窗口句柄，要向这个窗口应用由nCmdShow指定的命令
    .参数 nCmdShow, 整数型, , 为窗口指定可视性方面的一个命令。请用下述任何一个常数;SW_HIDE：隐藏窗口，活动状态给令一个窗口;SW_MINIMIZE：最小化窗口，活动状态给令一个窗口;SW_RESTORE：用原来的大小和位置显示一个窗口，同时令其进入活动状态;SW_SHOW：用当前的大小和位置显示一个窗口，同时令其进入活动状态;SW_SHOWMAXIMIZED：最大化窗口，并将其激活;SW_SHOWMINIMIZED：最小化窗口，并将其激活;SW_SHOWMINNOACTIVE：最小化一个窗口，同时不改变活动窗口;SW_SHOWNA：用当前的大小和位置显示一个窗口，不改变活动窗口;SW_SHOWNOACTIVATE：用最近的大小和位置显示一个窗口，同时不改变活动窗口;SW_SHOWNORMAL：与SW_RESTORE相同;

ShowWindowAsync.Data:
.DLL命令 ShowWindowAsync, 整数型, "user32", "ShowWindowAsync", 与ShowWindow相似，只是这时的ShowWindow命令会投递到指定的窗口，然后进行异步处理。这样一来，就可控制从属于另一个进程的窗口的可视情况。同时无须担心另一个进程挂起的时候，自己的应用程序也会牵连其中　如窗口之前是可见的，则返回TRUE（非零），否则返回FALSE（零）
    .参数 hWnd, 整数型, , 欲接收ShowWindow命令的窗口
    .参数 nCmdShow, 整数型, , 与ShowWindow相同;

StartDoc.Data:
.DLL命令 StartDoc, 整数型, "gdi32", "StartDocA", 开始一个打印作业　如执行成功，返回文档的作业编号，常数SP_ERROR失败。会设置GetLastError
    .参数 hdc, 整数型, , 设备场景的句柄
    .参数 lpdi, DOCINFO, , DOCINFO，对文档定义的一个结构;

SystemTimeToFileTime.Data:
.DLL命令 SystemTimeToFileTime, 整数型, "kernel32", "SystemTimeToFileTime", 根据一个FILETIME结构的内容，载入一个SYSTEMTIME结构　非零表示成功，零表示失败。会设置GetLastError
    .参数 lpSystemTime, SYSTEMTIME, , SYSTEMTIME，包含了系统时间信息的一个结构
    .参数 lpFileTime, FILETIME, , FILETIME，用于装载文件时间的一个结构;

TerminateProcess.Data:
.DLL命令 TerminateProcess, 整数型, "kernel32", "TerminateProcess",  结束一个进程　非零表示成功，零表示失败。会设置GetLastError
    .参数 hProcess, 整数型, , 指定要中断的一个进程的句柄
    .参数 uExitCode, 整数型, , 进程的一个退出代码;

ValidateRect.Data:
.DLL命令 ValidateRect, 整数型, "user32", "ValidateRect", 校验窗口的全部或部分客户区。这样便可告之windows指定的区域不需要重画　非零表示成功，零表示失败
    .参数 hwnd, 整数型, , 欲检验的窗口句柄
    .参数 lpRect, RECT, , RECT，指定一个矩形结构，用于描叙欲校验的矩形部分。可使用ValidateRectBynum，同时将lpRect设为零（Long数据类型），从而对整个窗口进行校验;

ValidateRgn.Data:
.DLL命令 ValidateRgn, 整数型, "user32", "ValidateRgn", 激活窗口中指定区域，把它从刷新区移走　执行成功为非零值，失败为0
    .参数 hwnd, 整数型, , 窗口句柄
    .参数 hRgn, 整数型, , 定义要激活区的区域句柄，该区域以窗口客户坐标表示;

WNetCancelConnection.Data:
.DLL命令 WNetCancelConnection, 整数型, "mpr.dll", "WNetCancelConnectionA", 结束一个网络连接　零表示成功。会设置GetLastError。如GetLastError是ERROR_EXTENDED_ERROR，则可用WNetGetLastError取得额外的错误信息
    .参数 lpszName, 文本型, , 已连接资源的远程名称或本地名称
    .参数 bForce, 整数型, , 如为TRUE，表示断开连接（即使连接的资源上正有打开的文件或作业）;

WinExec.Data:
.DLL命令 WinExec, 整数型, "kernel32", "WinExec", 运行指定的程序　大于32表示成功，请参考FindExecutable函数
    .参数 lpCmdLine, 文本型, , 包含要执行的命令行
    .参数 nCmdShow, 整数型, , 定义了以怎样的形式启动程序的常数值。参考ShowWindow函数的nCmdShow参数;

WindowFromPoint.Data:
.DLL命令 WindowFromPoint, 整数型, "user32", "WindowFromPoint", 返回包含了指定点的窗口的句柄。忽略屏蔽、隐藏以及透明窗口　包含了指定点的窗口的句柄。如指定的点处没有窗口存在，则返回零
    .参数 xPoint, 整数型, , x点值
    .参数 yPoint, 整数型, , y点值;

WriteProfileSection.Data:
.DLL命令 WriteProfileSection, 整数型, "kernel32", "WriteProfileSectionA", 为Win.ini初始化文件中一个指定的小节设置所有项名和值　非零表示成功，零表示失败。会设置GetLastError
    .参数 lpAppName, 文本型, , 要设置的小节。这个字串不区分大小写
    .参数 lpString, 文本型, , 项和值字串的一个列表。每个字串都用一个NULL字符分隔，最后一个字串后面用两个NULL表示中止。如lpAppName指定的小节不存在，则用那个名字新建一个小节，并将其追加到初始化文件的最后。如果存在，则当前的所有项名和值都会被这个缓冲区中指定的数据取代;

lcreat.Data:
.DLL命令 lcreat, 整数型, "kernel32", "_lcreat", 创建一个文件。如文件已经存在，就会将其缩短成零长度，并将其打开，以便读写　如执行成功，返回打开文件的句柄。如果出错，则返回HFILE_ERROR.
    .参数 lpPathName, 文本型, , 欲创建的文件的名字
    .参数 iAttribute, 整数型, , 下述值之一0――文件能够读写1――创建只读文件2――创建隐藏文件3――创建系统文件;

lopen.Data:
.DLL命令 lopen, 整数型, "kernel32", "_lopen", 以二进制模式打开指定的文件　如执行成功，返回打开文件的句柄。HFILE_ERROR表示出错。会设置GetLastError
    .参数 lpPathName, 文本型, , 欲打开文件的名字
    .参数 iReadWrite, 整数型, , 访问模式和共享模式常数的一个组合，如下所示：1、访问模式;READ：打开文件，读取其中的内容;READ_WRITE：打开文件，对其进行读写;WRITE：打开文件，在其中写入内容2、共享模式（参考OpenFile函数的标志常数表）OF_SHARE_COMPAT， OF_SHARE_DENY_NONE， OF_SHARE_DENY_READ， OF_SHARE_DENY_WRITE， OF_SHARE_EXCLUSIVE;

